import React from 'react';
import './Faculty.css';

function Faculty() {
  const faculty = [
    { id: 1, name: 'Dr. Vishwas Rao', image: '/images/faculty1.jpg' },
    { id: 2, name: 'Prof. Silky Goel', image: '/images/faculty2.jpg' },
    { id: 3, name: 'Dr.shahina anwarul ', image: '/images/faculty3.jpg' },
  ];

  return (
    <div className="faculty">
      <h2>Faculty Information</h2>
      <div className="faculty-list">
        {faculty.map((member) => (
          <div key={member.id} className="faculty-card">
            <img src={member.image} alt={member.name} />
            <p>{member.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Faculty;
